import React from "react";

const Submitdata = () => {
  return (
    <>
      <div>
        <div>
          <form>
            <input type="text" placeholder="Enter your first Name"></input>
            <input type="text" placeholder="Enter your Second Name"></input>
          </form>
        </div>
      </div>
    </>
  );
};
export default Submitdata;
